script: |
  super -f tsv -I q9952.sql | sort > q9952.out

vector: true

inputs:
  - name: q9952.sql
    data: |
      SELECT - NULLIF ( - COUNT ( * ), - + 17 ) * + 46 FROM tab0 AS cor0 GROUP BY col1, col0 HAVING NOT COUNT ( * ) = ( + ( col1 ) * CAST ( NULL AS INTEGER ) - + 56 ) OR NOT - col1 + - - NULLIF ( - COUNT ( * ), col0 ) IN ( + - col0 + + col0 );
  - name: tab0

outputs:
  - name: q9952.out
    data: |
      46
      46
      46
